// Now give $ and jQuery back to Drupal
// Going forward, use $oi where you would normally use $ for jQuery function calls
var $oi = jQuery.noConflict(true)

// Finally, include our jQuery
$oi( document ).ready(function() {

  // Detect Operating System
  $oi('html').addClass(navigator.platform);

  // Initialize popups.
  $oi('a[rel^=lightbox], a.popup').magnificPopup({
    type: 'image',
    closeOnContentClick: true,
    mainClass: 'mfp-img-mobile mfp-with-zoom',
    image: {
      verticalFit: true
    }
  });

  // Mobile nav - toggle, bootstrap-esque
  $oi('.nav-button').click(function(e) {
    $oi('.region-sidebar-first').hide();
    $oi('.mobile-top-nav-container').slideToggle();
    $oi(this).toggleClass('on');
  });

  // Define a function which will ensure that all landing page feature blocks have the same height, matching the height of the tallest block.
  function resizeFeatureBlocks() {
    var maxHeight = 0;

    $oi('.node-type-landing-page .feature-block').each(function() {
      $oi(this).removeAttr('style');
      if ($oi(this).height() > maxHeight) { maxHeight = $oi(this).height(); }
    });

    $oi('.node-type-landing-page .feature-block').height(maxHeight);
  }

  // Resize all the blocks on window load.
  $oi(window).load(function() {
    resizeFeatureBlocks();
  });

  // And then resize them whenever the browser is resize, just to make sure nothing looks horribly broken.
  $oi(window).on('resize', function() {
    resizeFeatureBlocks();
  });

  // Add captions to images
  $oi('.with-caption[title]').jcaption({
    imageAttr: 'title'
  });

  // Open/close mobile nav
  $oi('.mobile-section-navigation').click(function() {
    $oi('.region-sidebar-first').slideToggle(); 
    var arrow = $oi(this).find('span').html();
    if (arrow == 'navigateright') {
      $oi(this).toggleClass('open').find('span').html('navigatedown');
    } else {
      $oi(this).toggleClass('open').find('span').html('navigateright');
    }
  })


  // ** MOBILE **
  // give body .small-screen to only run mobile scripts on smaller screens
  function pageWidth() {
    return window.innerWidth != null? window.innerWidth: document.body != null? document.body.clientWidth:null;
  }

  if (pageWidth() < 768) {

  }

});
